  /** 
  * {"defaulttekst_overskrift":"Fullmakter","defaulttekst_brodtekst":"<p>\nHer vises hvem du har gitt fullmakt til eller fått fullmakt fra, og hvor lenge fullmaktene er gyldige. Du vil også kunne finne fullmakter du ikke har gitt selv, som for eksempel etter en vurdering fra lege. Her kan du også endre eller avslutte fullmakter du har gitt, eller opprette en ny fullmakt.\n</p>\n\n<p>\nDu må være over 16 år for å kunne gi en fullmakt til å benytte tjenester på vegne av andre. Den som får fullmakten må være over 18 år.\n</p>\n\n<h3>Samtykke</h3>\n<p>\nFor at du skal kunne gi en fullmakt, må du samtykke til de tjenestene fullmakten skal gjelde. Den du gir fullmakt kan ikke samtykke på vegne av deg.\n</p>\n\n<h3>Begrensninger og endringer?</h3>\n<p>\nEn fullmakt kan være gyldig i en begrenset periode, eller på ubestemt tid. Fullmakter som fremdeles er gyldige kan endres. Når en fullmakt endres vil den slettes, og en ny blir da automatisk opprettet, med endringene. Slettede fullmakter og fullmakter som ikke lenger er gyldige vil automatisk flyttes over i historikken.\n</p>\n\n<p>\nDu kan velge hva fullmakten skal omfatte ved å velge ett eller flere av de tre tjenesteområdene. Fullmakten vil automatisk gjelde for nye tjenester innen de valgte områdene, når de blir tilgjengelige. Dersom det legges til tjenester som må anses som en vesentlig endring, kan det hende at du må bekrefte fullmakten på nytt.\n</p>\n\n<p>\n<a href=\"{HelsenorgeUrl}/om-min-helse/slik-representerer-du-andre-paa-helsenorge-no\">Her kan du lese mer om å representere andre på Helsenorge</a>.\n</p>"}
  */
  hjelpekontekst_profilFullmakt: string;
  /** 
  * {"defaulttekst_overskrift":"Deling av helseopplysninger","defaulttekst_brodtekst":"<p>Her vises hvem du har gitt fullmakt til eller fått fullmakt fra, og hvor lenge fullmaktene er gyldige. Du vil også finne eventuelle fullmakter du ikke har gitt selv, som for eksempel vergemål. Her kan du også endre eller avslutte fullmakter du har gitt, eller opprette en ny fullmakt.</p><p>Du må være over 18 år for å kunne gi eller få fullmakt til å benytte tjenester på vegne av andre.</p><h3>Samtykke</h3><p>For at tjenestene skal fungere for den som får en fullmakt, må du samtykke til bruk av dialogtjenester og personlig helsearkiv. Du kan også velge å gi fullmakt til området profil, slik at den du gir fullmakt skal kunne samtykke på vegne av deg.</p><h3>Begrensninger og endringer?</h3><p>En fullmakt kan være gyldig i en begrenset periode, eller på ubestemt tid. Fullmakter som fremdeles er gyldige kan endres. Når en fullmakt endres vil den slettes, og en ny blir da automatisk opprettet, med endringene. Slettede fullmakter og fullmakter som ikke lenger er gyldige vil automatisk flyttes over i historikken.</p><p>Du kan gi fullmakt til alle tjenester som er tilgjengelige via fullmakt, eller til alle tilgjengelige tjenester innen et område. Fullmakten vil automatisk gjelde for nye tjenester innen de valgte områdene, når de blir tilgjengelige.</p>"}
  */
  hjelpekontekst_profilHelseopplysninger: string;
  /** 
  * {"defaulttekst_overskrift":"Bruk av helsetjenester og ordninger","defaulttekst_brodtekst":"<p>Her vises ulike tjenester og ordninger, og hvordan ditt forhold til dem er akkurat nå.</p><h3>Tjenester og ordninger du kan samtykke til å bruke</h3> <p>Dette vil si at du må gi ditt samtykke for å kunne benytte tjenesten eller ordningen. Hvis ikke vil du ikke ha tilgang til den. Du kan trekke tilbake samtykket ditt for kortere eller lengre tid, men du vil da samtidig miste tilgangen til tjenesten. Gjenoppretter du samtykket vil du igjen kunne benytte tjenesten.</p><h3>Tjenester og ordninger du kan reservere deg mot å bruke</h3><p>Dette vil si at tjenesten automatisk er tilgjengelig for deg, og du kan benytte den uten å først gjøre noe selv, som for eksempel gi et samtykke. Dersom du reserverer deg mot å bruke tjenesten eller ordningen, og du senere ombestemmer deg, må du kontakte brukerstøtte for helsenorge.no for å oppheve reservasjonen.</p>"}
  */
